import React, {Component} from 'react';
import {Link} from 'react-router-dom';

import BCChildrens from './BCChildrens';


class BlockContent extends Component {
    render() {
        return(
            <li className="parant dropdown aligned-left">
                <span className="open-child hidden-md hidden-lg">(open)</span>
                <Link to="" className="dropdown-toggle" title="" data-toggle="dropdown" data-clickable="1">
                    <span className="menu-title">{this.props.name}</span>
                    <b className="caret"></b>
                </Link>
                <div className="dropdown-menu">
                    <div className="dropdown-menu-inner">
                        <div className="row">
                            <BCChildrens />
                        </div>
                    </div>
                </div>
            </li>
        )
    }
}
export default BlockContent;
